import React, { useState, useEffect } from 'react'
export default function Pro() {
  const [post, getPost] = useState([])
  const API = 'http://localhost:3000/image';
  const API2 = 'http://localhost:3000/price';
  const api3 = API + API2
  const fetchPost = () => {
    fetch(API, API2)
      .then((res) => res.json())
      .then((res) => {
        console.log(res)
        getPost(res)
      })
  }
  useEffect(() => {
    fetchPost()
  }, [])
  return (
    <>
      <h2>React Fetch Data with REST API Example</h2>
      <ul>
        {post.map((item, id) => {
          return <img src={item.image}></img>
        })}
      </ul>
    </>
  )
}
